import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses=[
    {title:"Car Insurance", amount:294.67,date: new Date(2000,9,13)},
    {title:"Gym", amount:500.00,date: new Date(2000,10,18)},
    {title:"Steam", amount:1600,date: new Date(2000,12,4)}
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
        <ExpenseItem></ExpenseItem>
        <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
